import React, { Component } from 'react';

class TodoList extends Component {
    constructor() {
        super();
        this.state = {
            userInput: "",
            items: []
        }
    }
    render() {
        return (
            <div>
                <h1>Ma Todo list</h1>
                <form>
                    <input
                        value={this.state.userInput}
                        type="text"
                        placeholder="renseigner un item" />
                    onChange={this.onChange.bind(this)}
                    <button>Add</button>
                </form>
            </div>
        )
    }
}

export default TodoList
